package solutions;

import org.junit.Test;

import static org.junit.Assert.*;

/**
 * Tests Solution242.
 */
public class Solution242Test {
    @Test
    public void nagaramIsAnAnagramOfAnagram() {
        Solution242 solution242 = new Solution242();
        assertTrue(solution242.isAnagram("anagram", "nagaram"));
    }

    @Test
    public void carIsNotAnAnagramOfRat() {
        Solution242 solution242 = new Solution242();
        assertFalse(solution242.isAnagram("rat", "car"));
    }

    @Test
    public void aIsNotAnAnagramOfAb() {
        Solution242 solution242 = new Solution242();
        assertFalse(solution242.isAnagram("ab", "a"));
    }

    @Test
    public void debitCardIsAnAnagramOfBadCredit() {
        Solution242 solution242 = new Solution242();
        assertTrue(solution242.isAnagram("debit card", "bad credit"));
    }

    @Test
    public void bigStringIsAnAnagramOfBigString() {
        String big1 = "";
        String big2 = "";
        Solution242 solution242 = new Solution242();
        assertTrue(solution242.isAnagram(big1, big2));
    }
}
